import React, { useState } from "react";

const Analytics = () => {

    const [title, setTitle] = useState("")

    const createJournal = (e) => {
        setTitle(() => e.target.value)
    }

    return (
        <div>
            What is my worry?
            <input
                onChange={createJournal}
            />
            How likely is it that my worry comes true?
            <input
                onChange={createJournal}
            />
            If the worst did happen, what can I do to cope?
            <input
                onChange={createJournal}
            />
            <p>{title}</p>
            <button>I'm ready to let go of my negative thoughts!</button>
            <button>I'm not ready</button>
        </div>
    )
}

export default Analytics
